import React from 'react';
import './App.css';
import Navbar from './components/Navbar';
import Batteries from './components/Batteries';
import { Grid } from "@material-ui/core";


function App() {
  return (
    <div className="App">

      <Navbar/>
        <div>

          <Grid container>
          <Grid item xs = {2}>
          <Batteries/>
          </Grid>
          </Grid>

        </div>

    </div>

  );
}


